import React from "react";
import "./HowItWorksStep2.scss";
import { withTranslation } from 'react-i18next';

class HowItWorksStep2 extends React.Component {
  render() {
    const { t } = this.props;
    return (
      <div className="how-it-works-step-2">
        <div className="how-it-works-step-2-wrapper">
        <div className="questionnaire">
            <div className="questionnaire-header">
            {t("questionnaire-header")}  
            </div>
            <div className="questionnaire-item">
            Individual online inquirer for each employee powered by monitoring system of the level of completion across the company
            {t("questionnaire-header")}  
            </div>
            <div className="questionnaire-item">
            Average time for completion ~15 mins
            {t("questionnaire-header")}  
            </div>
            <div className="questionnaire-item">
            Results obtained right away after filling the form and accessible at the personal account
            {t("questionnaire-header")}  
            </div>
            <div className="questionnaire-item">
            Methodology enabling to put a flag on socially acceptable answers
            {t("questionnaire-header")}  
            </div>
          </div>
          <div className="questionnaire-img"></div>
        </div>
      </div>
    );
  }
}


export default withTranslation()(HowItWorksStep2);
